import{_ as a}from"./chunks/index.VAya1KE4.js";import{c as p,o as s,G as t,k as e}from"./chunks/framework.BFEalnvt.js";import"./chunks/theme.B1I7hsVa.js";import"./chunks/getArrayRandomItem.LhrzGfRF.js";const r=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"params":{"pkg":502306,"idList":[504621,504570,504440,501214,503614,501157,501213,6489,3386,1058,1433,1056,1220,1498,503613,503612,4074,4073,500207,1290,502928,502927,5111,1627,502306,500987,501624,2404,501625,501626,2142,4334,6180,59,75,1057,501441,4081,500419,5020,500291,5865,500286,6937,500673,4780,5494,3875,3564,3276,1360,2040,57,2123,2403,2124,55,111,1744,501212,500672,500605,500292,7257,6938,6594,6490,6285,5866,5493,5297,4781,4736,4333,4197,4148,3387,3275,2606,2125,2402,78,382,105,92,241,1221,54,644,56,61,112,76,79,1055,1291,1795,2415],"data":{"id":502306,"name":"希诺宁","summary":"焮火铸魂 · 希诺宁","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2024/10/04/4328207/ff1745c76b33c041c26e64e137dae368_8553993354333645956.png","avatar":{"m":"https://act-upload.mihoyo.com/wiki-user-upload/2024/10/04/4328207/f4abf4d98682f81b84c5302a4633b060_4187476418873789973.png","pc":"https://act-upload.mihoyo.com/wiki-user-upload/2024/10/04/4328207/a80fafa9b13a411ca4f1952fa8efe27c_1022188162048380884.png"},"attrs":[["地区","纳塔"],["星级","五星"],["神之眼所属","纳塔"],["元素","岩"],["武器","单手剑"],["生日","3月13日"],["所属","纳茨卡延"],["定位","岩元素辅助角色"],["武器类型","单手剑"],["命之座","豹猫座"],["称号","焮火铸魂"]],"destiny":[["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/10/04/4328207/70d599cc04b6bed5fb5fedafecfd8397_8262175585159008039.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px;\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/10/04/4328207/70d599cc04b6bed5fb5fedafecfd8397_8262175585159008039.png\\" style=\\"width: 40px;\\"></span></span></span>献予慵眠的休假日</p>","<p>希诺宁的夜魂加持状态消耗的夜魂值与燃素降低30%，且夜魂值的时间限制延长45%。</p><p>此外，希诺宁的「源音采样」激活时，还将提升队伍中附近的当前场上角色的抗打断能力。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/10/04/4328207/8b426abf4f28d22103f61880cb11ce37_702847232370074012.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px;\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/10/04/4328207/8b426abf4f28d22103f61880cb11ce37_702847232370074012.png\\" style=\\"width: 40px;\\"></span></span></span>献予灼原的五重奏</p>","<p>希诺宁携带的岩元素「源音采样」将始终保持激活状态。此外，希诺宁的「源音采样」激活时，将根据「源音采样」的元素类型，使队伍中附近所有元素类型相同的角色获得对应效果：</p><p>·岩元素：造成的伤害提升50%；</p><p>·火元素：攻击力提升45%；</p><p>·水元素：生命值上限提升45%；</p><p>·冰元素：暴击伤害提升60%；</p><p>·雷元素：恢复25点元素能量，且元素爆发的冷却时间缩短6秒。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/10/04/4328207/1c7b9ba22fdf12c41341c39951080ea6_1653096733688817157.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px;\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/10/04/4328207/1c7b9ba22fdf12c41341c39951080ea6_1653096733688817157.png\\" style=\\"width: 40px;\\"></span></span></span>献予日炎的巡行式</p>","<p>音火锻淬的技能等级提高3级。</p><p>至多提升至15级。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/10/04/4328207/49a53d5564160a3085ce89fc43dd28d6_944350665517791282.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px;\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/10/04/4328207/49a53d5564160a3085ce89fc43dd28d6_944350665517791282.png\\" style=\\"width: 40px;\\"></span></span></span>献予午后的花之梦</p>","<p>希诺宁施放音火锻淬后，将为队伍中附近的所有角色施加「荣花之赐」效果，持续15秒。</p><p>拥有「荣花之赐」的角色的普通攻击、重击与下落攻击造成的伤害提升，提升值相当于希诺宁的防御力的65%。该效果将在生效6次或持续时间结束时解除。</p><p>同时命中多名敌人时，会依据命中敌人的数量消耗生效次数；队伍中具有「荣花之赐」的角色，其生效次数单独计算。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/10/04/4328207/427fee6592af503fe6954a3dbebd21d5_2948155965824142423.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px;\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/10/04/4328207/427fee6592af503fe6954a3dbebd21d5_2948155965824142423.png\\" style=\\"width: 40px;\\"></span></span></span>献予夕暮的转格调</p>","<p>豹烈律动！的技能等级提高3级。</p><p>至多提升至15级。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/10/04/4328207/47347315caaebdc8c89e6bd7f4029af1_4279769240525153376.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px;\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/10/04/4328207/47347315caaebdc8c89e6bd7f4029af1_4279769240525153376.png\\" style=\\"width: 40px;\\"></span></span></span>献予永夜的狂欢舞</p>","<p>处于夜魂加持状态下时，希诺宁进行冲刺、腾跃、普通攻击、下落攻击时，将获得「永夜的祝福」，无视夜魂加持状态下的限制，并提升普通攻击与下落攻击造成的伤害，持续5秒。</p><p>持续期间：</p><p>·暂停希诺宁的夜魂值时间限制计时，希诺宁的夜魂值、燃素、体力将不再下降，且夜魂值达到上限时，希诺宁的夜魂加持也不会结束；</p><p>·希诺宁在夜魂加持状态下的普通攻击与下落攻击造成的伤害提升，提升值相当于希诺宁的防御力的300%。</p><p>·每1.5秒为附近的队伍中所有角色恢复生命值，回复量相当于希诺宁的防御力的120%。</p><p>每15秒至多获得一次「永夜的祝福」。</p>"]],"skill":[{"title":"普通攻击·锐锋攫猎","desc":"\\n普通攻击\\n进行至多三段的连续剑击。\\n\\n重击\\n消耗一定体力，向前方使出踢击。\\n\\n下落攻击\\n从空中下坠冲击地面，基于希诺宁的防御力，攻击下落路径上的敌人，并在落地时造成范围伤害。\\n\\n夜魂状态·刃轮巡猎\\n在夜魂加持状态下，希诺宁将切换至「刃轮巡猎」模式，在这种状态下，希诺宁的普通攻击将转为以刃轮鞋进行至多四段的连续踢击，无法进行重击。\\n在这种状态下进行普通攻击与下落攻击时，将转为基于希诺宁的防御力，造成具有夜魂性质且无法被附魔覆盖的岩元素伤害。","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2024/10/04/4328207/1ad165ba2aeb9522fc23cdea2e0842cc_8223079506249994368.png"},{"title":"音火锻淬","desc":"让热情的律动响彻大地！希诺宁切换至用于高速战斗的刃轮装束，并向前突进一段距离，基于希诺宁的防御力，造成具有夜魂性质的岩元素伤害。\\n施放后，希诺宁将获得45点夜魂值，进入夜魂加持状态，在这种状态下，希诺宁将切换至「刃轮巡猎」模式。\\n\\n源音采样\\n希诺宁拥有三枚采样器，根据队伍中其他角色的元素类型，能够呈现出不同的「音型」，并在激活时降低附近的敌人的对应元素抗性；\\n三枚采样器初始记录的「源音采样」均为岩元素，队伍中每存在一名火元素、水元素、冰元素或雷元素角色，一枚岩元素采样便将转变为对应的元素类型；\\n处于夜魂加持状态下时，希诺宁携带的岩元素「源音采样」将始终保持激活状态；解锁固有天赋「四境四象回声」后，希诺宁可以通过触发固有天赋「四境四象回声」的效果为自己恢复夜魂值；在夜魂值达到上限时，希诺宁将会消耗全部夜魂值，激活希诺宁自己携带的三枚「源音采样」，持续15秒；\\n「源音采样」激活时，附近的敌人的对应元素抗性降低，同元素类型「源音采样」的效果不能叠加；希诺宁处于队伍后台时，同样能产生该效果。\\n\\n夜魂加持·希诺宁\\n持续消耗夜魂值。夜魂值耗尽时，或是再次施放时，希诺宁的夜魂加持将会结束。夜魂加持状态具有如下特性：\\n·切换至「刃轮巡猎」模式，提升希诺宁的移动速度与攀爬速度，且攀爬时能够以豹猫形态进行高速腾跃；\\n·希诺宁的夜魂加持状态具有如下限制：处于夜魂加持状态下时，希诺宁的夜魂值有9秒的时间限制，超过时间限制后，希诺宁的夜魂值将立刻耗竭。\\n\\n处于夜魂加持状态下时，夜魂值耗竭后，希诺宁将无法通过固有天赋「四境四象回声」产生夜魂值。\\n\\n从某种意义上来说，锻造宝石与混音的原理或许有一定相通之处：滤除杂质，只保留最为闪耀之物。\\n不过希诺宁向来是无所谓的，毕竟两者对她而言都是无比快乐的事情嘛。","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2024/10/04/4328207/1bf419e4a9a2ccc3ae80d72acccaa280_2874595602879399642.png"},{"title":"豹烈律动！","desc":"以最大输出功率开启立体声燃素工学调音台（便携式），基于希诺宁的防御力，造成具有夜魂性质的岩元素范围伤害。\\n\\n此外，根据「源音采样」的类型不同，还将相应触发以下效果：\\n·拥有至少两枚经过元素转化的「源音采样」：希诺宁奏响「欢兴」的律动，每隔一段时间，为附近的当前场上角色恢复生命值，回复量受益于希诺宁自己的防御力；\\n·拥有少于两枚经过元素转化的「源音采样」：希诺宁奏响「燥烈」的律动，进行两次额外的节拍演奏，基于希诺宁的防御力，造成具有夜魂性质的岩元素范围伤害。\\n\\n「好，先在这里停顿一下！」\\n「没关系没关系，刚才的节拍我已经记录下来了。让我试试看，把我们的旋律混合在一起，会演奏出怎样的音色吧。」","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2024/10/04/4328207/c9548fcf9f224014d3bfbb540abc3869_5572990211368810244.png"},{"title":"四境四象四回声","desc":"在夜魂加持状态下：\\n·若希诺宁拥有至少两枚经过元素转化的「源音采样」，在普通攻击与下落攻击命中敌人时，将获得35点夜魂值，该效果每0.1秒至多触发一次；\\n·若希诺宁拥有少于两枚经过元素转化的「源音采样」，普通攻击与下落攻击造成的伤害提升30%","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2024/10/04/4328207/fe219d56af460a2427d2792b9f50cbd2_8150600602884377498.png"},{"title":"便携铠装护层","desc":"在夜魂加持状态下，希诺宁的夜魂值达到上限时，将触发一次等同于「夜魂迸发」的效果，该效果每14秒至多触发一次。\\n此外，队伍中的附近的角色触发「夜魂迸发」时，希诺宁的防御力提升20%，持续15秒。","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2024/10/04/4328207/dc2bdb19132f85aeee23f25b7dc144f2_2924756850262598336.png"},{"title":"夜域赐礼·锻火之祝","desc":"在夜魂值耗竭后，希诺宁将会转而消耗燃素来维持夜魂加持。\\n在纳塔存在燃素机制的区域时，能够进行夜魂传递·希诺宁。\\n当前场上角色处于冲刺、攀爬或是特定天赋赋予的移动状态下，或是位于一定高度的空中时，切换希诺宁登场时触发：希诺宁将进入夜魂加持状态，并获得20点夜魂值。\\n在这种情况下，希诺宁的夜魂值有4秒的时间限制，超过时间限制后，希诺宁的夜魂值将立刻耗竭，在时间限制内施放音火锻淬后，夜魂值的时间限制将延长9秒。\\n自己的队伍每10秒可以触发一次夜魂传递。\\n\\n此外，位于纳塔地区时，在夜魂加持状态下，希诺宁攀爬将不再消耗体力。","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2024/10/04/4328207/2a3e3c012e1a36c82f8004f586064cf0_1722095617501006421.png"},{"title":"丛山锻火驰行","desc":"触发夜魂传递时，恢复15点燃素。","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2024/10/04/4328207/8b52ca241ec11cadbc0cad47b03556d7_6973344300148969872.png"}]},"favModalLocalKey":"vitepress_game_ys_role_fav_modal","favLocalKey":"vitepress_game_ys_role_fav"},"relativePath":"game/ys/role/502306.md","filePath":"game/ys/role/[pkg].md"}'),c={name:"game/ys/role/502306.md"},g=Object.assign(c,{setup(i){return(o,d)=>(s(),p("div",null,[t(e(a))]))}});export{r as __pageData,g as default};
